message:
*CDBr INFORMA:* *Vamos fazer um resumo do que sabemos que é verídico até agora:*

✅ Vídeos de PF e militares instruindo as pessoas a como devem fazer a manifestação;
✅ Militares registrando com câmeras e drones a manifestação do povo lotando a porta do quartel. Isso não é a toa...
✅ Grande mobilização e distribuição de veículos urbanos e tropas, que são usados para GLO (Garantia da Lei e Ordem) e até agora não vimos indo pra cima de caminhoneiros;
✅ Silêncio de Presidente sobre as eleições, pedindo apenas o desbloqueio das vias, mas pedindo pra continuar com as manifestações da CONSTITUIÇÃO;
✅ Xandão saiu nervoso e calado, após reunião que era pra ter definido a grande vitória dele;
✅ Grandes mídias internacionais já estão sabendo e divulgando sobre a fraude. Enquanto a velha mídia segue calada, para tentar esconder do povo e do mundo;
✅ TSE querendo amedrontar as pessoas na rua, mesmo em manifestação pacífica (Qual motivo?);
✅ Várias pessoas influentes sem cargos políticos que estão diretamente ligadas ao PR, como Pablo Marçal, dizendo pra ter confiança no capitão.

Se atentem aos detalhes..
Brasileiro é um povo ansioso e acha que as coisas vão ser resolvidas da noite pro dia. A burocracia do Brasil é lenta. Não lembra como eram as filas antes de Bolsonaro?

Tem muita informação errada circulando, muitas tentando desanimar o povo, colocar medo, criar caos.

Na Argentina eles não sabem que a situação é tão feia, porque a mídia é comprada. A mesma coisa na China. Essa é a regulação de mídia. Ela já começou aqui, por isso não vimos nada sobre as manifestações nacionais passando na TV aberta.
Criem listas de transmissão, entrem em grupos.. essa manifestação precisa criar mais força. Só ficar em casa orando agora não vai salvar ninguém.. Vai orar lá na frente do quartel vai ter um monte de gente fazendo o mesmo!

A ordem é simples:
*VÃO PRA FRENTE DOS QUARTÉIS, E ESPEREM O AGIR DAS FFAA.*
